import React from "react";

class ReservationList extends React.Component{
    render(){
        return(
            <div>
                <p>{this.props.date}</p>
                <p>{this.props.shop}</p>
                <p>{this.props.address}</p>
                <p>{this.props.telephone}</p>
                <button>상세보기</button>
            </div>
        )
    
    }
        
}
export default ReservationList;
